import React, { useState, useEffect } from 'react';
import { TiDownload } from "react-icons/ti";
export default function Profile(props) {
    const [name, setName] = useState('');
    const [email, setEmail] = useState('');
    const [path1, setPath1] = useState([]);
    const [path2, setPath2] = useState([]);

    useEffect(() => {
        const fetchUserData = async () => {
            try {
                const response = await fetch(`http://localhost:5500/info?username=${props.user}`);
                if (!response.ok) {
                    throw new Error('Failed to fetch user data');
                }
                const data = await response.json();
                setName(data.name);
                setEmail(data.email);
                setPath1(data.path1 || []);
                setPath2(data.path2 || []);
            } catch (error) {
                console.error('Error fetching user data:', error);
            }
        };
        fetchUserData();
    }, [props.user]);

    const handleDownload = async (path) => {
        try {
            const response = await fetch(`http://localhost:5500${path}`);
            const blob = await response.blob();

            const downloadLink = document.createElement('a');
            downloadLink.href = window.URL.createObjectURL(blob);
            downloadLink.download = 'Styled_Image.jpg';
            downloadLink.click();
        } catch (error) {
            console.error('Download error:', error);
        }
    };

    return (
        <div className="container mt-5">
            <div className="row" style={{ marginTop: "80px", marginBottom: "20px" }}>
                <div className="col-md-4">
                    <div className="card">
                        <div className="card-body">
                            <h5 className="card-title">{name.toUpperCase()}</h5>
                            <button className='btn btn-dark' onClick={props.loggedout} style={{ backgroundColor: "#FFA07A", color: "#242424", borderColor: "white" }}>LogOut</button>
                        </div>
                    </div>
                </div>
                <div className="col-md-8">
                    <div className="card">
                        <div className="card-body">
                            <h5 className="card-title">Profile Information</h5>
                            <ul className="list-group list-group-flush">
                                <li className="list-group-item"><strong>Name : </strong> {name}</li>
                                <li className="list-group-item"><strong>Email : </strong> {email}</li>
                            </ul>
                        </div>
                    </div>
                    <div className="card mt-3">
                        <div className="card-body">
                            <h5 className="card-title text-center">StyleTransfer Activity</h5>
                            <div className="image-gallery" style={{ display: "flex", justifyContent: "space-between" }}>
                                {path1.map((path, index) => (
                                    <>
                                        <img key={index} src={`http://localhost:5500/${path}`} alt="" style={{ height: "200px", width: "200px", marginTop: "10px", marginBottom: "5px" }} />
                                        <div><button className="btn btn-success" style={{ marginTop: "15px" }} onClick={handleDownload(path)}><TiDownload style={{ marginBottom: "4px" }} /> Download</button></div>
                                    </>
                                ))}
                            </div>
                            <h5 className="card-title text-center my-2">DeepDream Activity</h5>
                            <div className="image-gallery">
                                {path2.map((path, index) => (
                                    <img key={index} src={`http://localhost:5500/${path}`} alt="" style={{ height: "200px", width: "200px", marginTop: "5x", marginBottom: "10px" }} />
                                ))}
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
}
